class SubmissionPublisher:
    def __init__(self, db_manager: DatabaseManager):
        self.db_manager = db_manager

    def publish_submission(self, submission_id: str) -> Dict:
        check_query = "SELECT id FROM published_submissions WHERE submission_id = %s"
        existing = self.db_manager.execute_query(check_query, (submission_id,))

        if existing:
            return {"status": "failed", "reason": "duplicate submission"}

        publish_query = """
        INSERT INTO published_submissions (submission_id, published_at)
        VALUES (%s, %s)
        RETURNING id
        """
        result = self.db_manager.execute_query(publish_query, (submission_id, datetime.datetime.now()))

        if result:
            self.db_manager.execute_query(
                "UPDATE submissions SET publish_status = 'PUBLISHED' WHERE id = %s",
                (submission_id,)
            )
            return {"status": "success", "publication_id": result[0][0]}
        return {"status": "failed", "reason": "database error"}

class DataConsumer:
    def __init__(self, db_manager: DatabaseManager):
        self.db_manager = db_manager

    def get_published_fabs_file(self, publication_id: str) -> Optional[Dict]:
        query = """
        SELECT f.* 
        FROM fabs_records f
        JOIN published_submissions p ON f.submission_id = p.submission_id
        WHERE p.id = %s
        """
        records = self.db_manager.execute_query(query, (publication_id,))
        if records:
            return {"publication_id": publication_id, "records": records}
        return None
